    @Test
    public void toDotnet() throws Exception {

        String des = "12345678";


        DESKeySpec desKeySpec = new DESKeySpec(des.getBytes("UTF-8"));

        SecretKeyFactory keyFactory = SecretKeyFactory.getInstance("DES");
        SecretKey secretKey = keyFactory.generateSecret(desKeySpec);


        IvParameterSpec iv = new IvParameterSpec(des.getBytes("UTF-8"));

        Cipher cipher = Cipher.getInstance("DES/CBC/PKCS5Padding");

        cipher.init(Cipher.ENCRYPT_MODE, secretKey, iv);

        Cipher cipher1 = Cipher.getInstance("DES/CBC/PKCS5Padding");
        cipher1.init(Cipher.DECRYPT_MODE, secretKey, iv);


        BufferedWriter br = new BufferedWriter(new FileWriter("toDotnetJAVA_DES.txt"));

        try {
            for (int i = 0; i < 1000; i++) {

                String plainText = randomString(10240);
                br.write(plainText);
                br.write("\n");

                byte[] plainBytes = plainText.getBytes("UTF-8");
                byte[] encrypted = cipher.doFinal(plainBytes);
                String encryptedString = Base64.encodeBase64URLSafeString(encrypted);//  new String(encrypted,"UTF-8");
                br.write(encryptedString);
                br.write("\n");
                String encryptedString1 = Base64.encodeBase64String(encrypted);//  new String(encrypted,"UTF-8");
                br.write(encryptedString1);
                br.write("\n");

                br.write("encrypted[]=" + encrypted.length + " encryptedString=" + encryptedString.length() + " aa=" + encryptedString1.length());
                br.write("\n");


                byte[] encryptedBytes = Base64.decodeBase64(encryptedString);//hex2byte(plainText);
                byte[] originalBytes = cipher1.doFinal(encryptedBytes);
                String originalString = new String(originalBytes, "UTF-8");


                Assert.assertEquals(plainText, originalString);

                System.out.println("i=" + i);

            }
        } catch (Exception e) {
            e.printStackTrace();
        } finally {
            br.close();
        }

        ///////////////////////
    }


